import React from 'react';
import UploadRecord from './components/UploadRecord';
import GrantConsent from './components/GrantConsent';
import DownloadRecord from './components/DownloadRecord';

function App() {
  return (
    <div style={{padding:20}}>
      <h1>DMRS MVP Frontend</h1>
      <h2>Upload Encrypted Record</h2>
      <UploadRecord />
      <hr />
      <h2>Grant Consent</h2>
      <GrantConsent />
      <hr />
      <h2>Download & Decrypt Record</h2>
      <DownloadRecord />
    </div>
  );
}

export default App;
